    //     <Route path="/article/:id" element= {<Single/>} />
    //     <Route path="/" element={<Home />} />
    //   </Routes>
    // </Router>

    <Router>
      <TopBar />
      <Routes>
        <Route path="/" element={<Outlet />}> {/* Wrap child routes with Outlet */}
          <Route path="/" element={<Home />} />
          <Route path="/welcome" element={<Welcome />} />
          <Route path="/article/:id" element={<Single />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
